I understand that my comment here has nothing to do with fashion and/or anything to do with clothing or style; 

 If you are ever in Oregon and want to do the Oregon Ghost Town road trip, let me know! I will take time off of work to go with you & Tyler! 
 It is something I have always wanted to do, I have lived here in the state for 4 years and I figure if anyone wanted to do it the right way? It would be you guys :)
